// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./AccessControl.sol";
import "./PaymentManager.sol";
import "@openzeppelin/contracts/access/Ownable.sol";



contract FileManager is Ownable {
    bytes32[] private fileHashes;

    struct Metadata {
        string name;   // File name
        string fileType; // MIME type (e.g., "image/png")
        uint256 size;  // File size in bytes
    }

    struct File {
        address owner;
        bytes32 fileHash; // Hash of the file stored in IPFS
        string metadata;  // Optional metadata (e.g., file name, type)
    }

    mapping(bytes32 => File) public files;
    AccessControl private accessControl;
    PaymentManager private paymentManager;

    event FileUploaded(address indexed owner, bytes32 indexed fileHash, string metadata);

    constructor(address accessControlAddress, address paymentManagerAddress)
        Ownable(msg.sender)
    {
        accessControl = AccessControl(accessControlAddress);
        paymentManager = PaymentManager(paymentManagerAddress);
    }
    function setAccessControlContract(address accessControlAddress) public onlyOwner {
        accessControl = AccessControl(accessControlAddress);
    }

    function uploadFile(bytes32 fileHash, string memory metadata) public {
        require(files[fileHash].owner == address(0), "File already exists");
        files[fileHash] = File(msg.sender, fileHash, metadata);
        fileHashes.push(fileHash);
        emit FileUploaded(msg.sender, fileHash, metadata);
    }

    function grantAccess(bytes32 fileHash, address user, uint256 duration) public {
        require(files[fileHash].owner == msg.sender, "Not the owner");
        accessControl.grantAccess(fileHash, user, duration);
    }

    uint256 public accessFee = 0.01 ether;
    
    function payAndGrantAccess(bytes32 fileHash, address payable recipient, uint256 duration) public payable {
        require(msg.value >= accessFee, "Insufficient payment");
        require(files[fileHash].owner == recipient, "Recipient is not the owner");
        paymentManager.pay{value: msg.value}(recipient);
        accessControl.grantAccess(fileHash, msg.sender, duration);
    }

    function checkAccess(bytes32 fileHash, address user) public view returns (bool) {
        return accessControl.hasAccess(fileHash, user);
    }

    function getFilesByOwner(address owner) public view returns (bytes32[] memory) {
    uint256 count = 0;

    // Count the files owned by the user
    for (uint256 i = 0; i < fileHashes.length; i++) {
        if (files[fileHashes[i]].owner == owner) {
            count++;
        }
    }

    bytes32[] memory ownerFiles = new bytes32[](count);
    uint256 index = 0;

    // Collect file hashes owned by the user
    for (uint256 i = 0; i < fileHashes.length; i++) {
        if (files[fileHashes[i]].owner == owner) {
            ownerFiles[index] = fileHashes[i];
            index++;
        }
    }

    return ownerFiles;
}

}

