// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AccessControl {
    struct Access {
        address user;
        uint256 expiresAt;
    }

    mapping(bytes32 => Access[]) private fileAccess;

    event AccessGranted(bytes32 fileHash, address user, uint256 expiresAt);

    function grantAccess(bytes32 fileHash, address user, uint256 duration) public {
        uint256 expiresAt = block.timestamp + duration;
        fileAccess[fileHash].push(Access(user, expiresAt));
        emit AccessGranted(fileHash, user, expiresAt);
    }

    function hasAccess(bytes32 fileHash, address user) public view returns (bool) {
        for (uint256 i = 0; i < fileAccess[fileHash].length; i++) {
            if (fileAccess[fileHash][i].user == user && fileAccess[fileHash][i].expiresAt > block.timestamp) {
                return true;
            }
        }
        return false;
    }
}

